import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after filling the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Take screenshot after clicking the search button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search_button.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search_button.png'));

    // Wait for search results to appear
    await page.waitForSelector('.products-grid', { timeout: 5000 });

    // Extract meaningful data to verify task completion
    const products = await page.$$eval('.product-card', cards => 
      cards.map(card => ({
        title: card.querySelector('.product-title').innerText,
        price: card.querySelector('.product-price').innerText,
      }))
    );

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted product data",
      extractedData: { products },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
